import React from 'react';
//import { BrowserRouter, Switch } from 'react-router-dom';
//import { Route } from 'react-router-dom';
import {Link, Route, Switch} from 'react-router-dom'
import Navbar from './components/Navbar';
import Header from './components/Header';
import Proyectos from './components/Proyectos';
import Tecnologias from './components/Tecnologias';
import SobreMi from './components/SobreMi';
import Contacto from './components/Contacto';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
          <Route path="/proyectos" exact= {true} component={Proyectos}></Route>
          <Route path="/tecnologias" exact= {true} component={Tecnologias}></Route>
          <Route path="/sobremi" exact= {true} component={SobreMi}></Route>
          <Route path="/contacto" exact= {true} component={Contacto}></Route>
      </Switch>
      <Header />
    </Router>
  );
}

export default App;
